import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div id="quote-box">
        <div id="text"></div>
        <div id="author"></div>
        <button id="new-quote"></button>
        <a href="" id="tweet-quote">
          tweet
        </a>
      </div>
    </div>
  );
}

export default App;
